import React from 'react';
import './contact.scss';
import LabelInput from '../labelInput/labelInput';
import LabelInputEmail from '../labelInputEmail/labelInputEmail';
import LabelTextarea from '../labelTextarea/labelTextarea';

const Contact = (): JSX.Element => {

    const onSubmit = (event: React.FormEvent<HTMLInputElement>):void => {
        event.preventDefault();
        console.log("submitted");
    }

    return (
        <div className="contact">
            <div className="contact__title">
                <span>Project?</span>
                <span>Qustions?</span>
            </div>
            <div className="contact__text">
                <span>Send us an e-mail or use the form.</span>
                <a href="mailto:contact@meijer.com" className="contact__text__email">contact@meijer.com</a>
            </div>
            <form className="contact__form" action="#">
                <LabelInput classNameAdded="contact__form__name" autoComplete="name" placeHolder="Name" />
                <LabelInput classNameAdded="contact__form__company" autoComplete="organization" placeHolder="Company" />
                <LabelInput classNameAdded="contact__form__email" autoComplete="email" placeHolder="Email" />
                <LabelInput classNameAdded="contact__form__phone" autoComplete="tel" placeHolder="Phone" />
                <LabelTextarea classNameAdded="contact__form__message" placeHolder="Message" />
                <div className="contact__form__submit">
                    <input type="submit" className="contact__form__submit__button" value="Submit" onSubmit={onSubmit}/>
                </div>
                <div className="contact__form__error-message"><span>One or more fields have an error. Please check and try
                    again.</span>
                </div>
            </form>
        </div>
    );
}

export default Contact;
